import React from "react";
import classes from './About.module.css';

const About = () => {
    return (
        <div className={classes.main}>
            <h3 className={classes.name}>Даниил Исаев</h3>
            <p className={classes.myBD}>10.06.1998</p>
            <div className={classes.infoA}><strong>Город:</strong> Томск</div>
            <div className={classes.infoB}><strong>Пол: </strong>мужчина</div>
            <div className={classes.male}/>
            <div className={classes.infoC}><strong>Возраст: </strong>23</div>
            <div className={classes.infoD}><strong>О себе:</strong> Всем привет! Меня зовут Яна, мне 22 года, я студент. Учусь на программиста, но хочу стать продуктовым аналитиком. Недавно, например, я начала проходить курс на известной платформе, который поможет мне устроиться на работу моей мечты! 
BTW: И да, у меня есть милая кошка :)</div>
            <div className={classes.infoE}><strong>Домашнее животное:</strong> есть</div>
        </div>
    );
};

export default About;
